type AppProps = {
  message: string;
  count: number;
  disabled: boolean;
  names: string[];
  status: "waiting" | "success";
  obj: {
    id: string;
    title: string;
  };
  objArr: {
    id: string;
    title: string;
  }[];
  obj2: unknown;
  obj3: Record<string, unknown>;
  dict1: Record<string, MyTypeHere>;
  dict2: Record<string, MyTypeHere>;
  onClick: () => void;
  onChange: (id: number) => void;
  onChangeWithEvent: (event: React.ChangeEvent<HTMLInputElement>) => void;
  onClickWithEvent: (event: React.MouseEvent<HTMLButtonElement>) => void;
  onSomething: () => void;
  optional?: OptionalType;
  setState: React.Dispatch<React.SetStateAction<number>>;
};

/**
 * Notes:
 * - Replaced "object" with "unknown" for obj2 as "object" type does not allow accessing properties, whereas "unknown" type does not allow accessing properties without type assertion.
 * - Replaced obj3 with Record<string, unknown> as it provides a similar structure (no required properties) but is more commonly used.
 * - Renamed the second onChange and onClick definitions with additional suffix "WithEvent" to avoid naming conflict.
 * - Replaced dict1 type with Record<string, MyTypeHere> which is equivalent to dict2.
**/

// Example usage:
const props: AppProps = {
  message: "Hello",
  count: 5,
  disabled: false,
  names: ["Alice", "Bob"],
  status: "waiting",
  obj: {
    id: "123",
    title: "Example"
  },
  objArr: [
    { id: "1", title: "Item 1" },
    { id: "2", title: "Item 2" }
  ],
  obj2: {},
  obj3: {},
  dict1: {
    key1: value1,
    key2: value2
  },
  dict2: {
    key1: value1,
    key2: value2
  },
  onClick: () => {
    console.log("Button clicked");
  },
  onChange: (id) => {
    console.log("Value changed:", id);
  },
  onChangeWithEvent: (event) => {
    console.log("Input changed:", event.target.value);
  },
  onClickWithEvent: (event) => {
    console.log("Button clicked:", event.target);
  },
  onSomething: () => {
    console.log("Something happened");
  },
  optional: "Optional value",
  setState: (newValue) => {
    console.log("State updated:", newValue);
  }
};

class HelloWorld:
    def __init__(self):
        self.message = "Hello, World!"

    def say_hello(self):
        print(self.message)

# Create an instance of the class
hello = HelloWorld()

# Call the say_hello method
hello.say_hello()
